  [],\n\t\"revision_timestamp\": \"2015-09-27T02:49:17.384427\",\n\t\"name\": \"temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation45c29\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115403 includes chemical,
  discrete sample, physical and profile data collected from JOHAN HJORT in the North
  Greenland Sea and Norwegian Sea from 1992-11-05 to 1992-12-01 and retrieved during
  cruise CARINA/58JH19921105. These data include AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride
  (CCL4), DELTA HELIUM-3, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE,
  NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen
  isotope), WATER TEMPERATURE and methyl chloroform (MC). The instruments used to
  collect these data include CTD and bottle. These data were collected by J. Blindheim
  and F. Rey of Institute of Marine Research - Norway as part of the CARINA/58JH19921105
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\":
